⁣
I’ve been training consecutively for about 3 years now. I had a #Flashback today of when I first walked into the gym terrified of picking up a dumbbell or any weight of that matter. ⁣
⁣
I was scared.⁣
I was lonesome.⁣
I was wanting to go straight to the cardio machines. ⁣
⁣
I knew what I had to do but was #Scared! ⁣
⁣
I wanted to build muscle.⁣
I wanted to eat more food but was terrified to gain weight. ⁣
I wanted to mold curves but was scared to lift and nourish my body to #Recomp it. ⁣
⁣
I knew what I wanted...BUT I always let fear win! ⁣
⁣
Until the day I committed to #Bodybuilding ⁣
I was sick of being stuck.⁣
I was sick of being fragile and cold.⁣
I was sick of staying stuck in a life that was killing me. ⁣
⁣
That was the day I begun to #Soar ⁣
⁣
I let food be fuel.⁣
I let weights be powerful.⁣
I let go of the scale and focused on building muscles. ⁣
⁣
And YOOO....it was NOT easy! But ya know what? My life changed quickly as I stopped using fear as an excuse. ⁣
⁣
Since then... ⁣
I’ve built muscle.⁣
I’ve joined an incredible team.⁣
I’ve found a healthy relationship with food and that YO girl can eat.⁣
I’ve found the best coach and friends a girl could ask for. ⁣
I’ve found the stage as my time to #Shine ⁣
And I am continuing to build a life that brings me joy! ⁣
⁣
Fear can be scary BUT don’t let fear get in the way of you prospering forward in life to be your authentic self. ⁣
